import TestingCard from "./components/TestingCard";
import  ReactDOM from "react-dom";
import Person from "./components/Person";




const App = () =>{
    return(
        <div>
      <TestingCard> 
       <Person 
       name ={"Gurvinder Singh"}/>
    </TestingCard>

        <Person 
       name ={"Harpreet Kaur"}/>
  
        </div>

        
    )
}

ReactDOM.render(
    <App />,
    document.querySelector('#root')
)
